function DashAttend()
{
    return(
<div className="col-md-6 col-sm-6 col-lg-6 col-xl-3">
                    <div className="dash-widget">
                        <span className="dash-widget-bg2"><i className="fa fa-user-md"></i></span>
                        <div className="dash-widget-info text-right">
                            <h3>15</h3>
                            <span className="widget-title2">Attended <i className="fa fa-check" aria-hidden="true"></i></span>
                        </div>
                    </div>
                </div>
                
    );
            }

            export default DashAttend;
